import { Box } from "@material-ui/core";
import React from "react";
import styled from "styled-components";
import Body from "../Typography/Body";
import Caption from "../Typography/Caption";
import Title from "../Typography/Title";


function Form() {
    return (
        <>
            <Box pb={1} pt={1}>
                <Title>Know more</Title>
            </Box>
            <FormWrapper>
                <TextWrapper>
                    <Box pb={1} pt={1}>
                        <Caption>
                            Address
                    </Caption>
                    </Box>
                    <Box pb={1} pt={1}>
                        <Body>Megenagna, ABC bldg. Office no. 123, Addis Ababa Ethiopia.</Body>
                    </Box>
                </TextWrapper>

                <TextWrapper>
                    <Box pb={1} pt={1}>
                        <Caption>
                            Phone
                    </Caption>
                    </Box>
                    <Box pb={1} pt={1}>
                        <Box pb={1}>
                            <Body>+251 911 77 88 88</Body>
                        </Box >
                        <Box pb={1}>
                            <Body>+251 911 77 88 88</Body>
                        </Box>

                    </Box>
                </TextWrapper>

                <TextWrapper>
                    <Box pb={1} pt={1}>
                        <Caption>
                            Follow us
                    </Caption>
                    </Box>
                    <Box pb={1} pt={1}>
                        <Body>This is the addres</Body>
                    </Box>
                </TextWrapper>



            </FormWrapper>

        </>
    );
}

const TextWrapper = styled.div`

`;
const FormWrapper = styled.div`
display: flex;
flex-direction: column;
row-gap: 40px;
width: fit-content;
margin-top:20px;
`;


export default Form;
